/** @jsx jsx */
/** @jsxRuntime classic */
import { css, jsx } from "@emotion/core";
import navLogo from "../../navLogo.svg";


const HeroNavLogo = () => <div><a href="/"> <h2 css={styles} src="">movieverse</h2> </a> <img src={ navLogo }/> </div> 

const styles = css`
    font-size: 22px;
    font-weight: 800;
    margin-right: 140px;
    user-select: none;

`;

export default HeroNavLogo;
